def how_many_times(string: str, substring: str) -> int:
    count = 0
    n = len(substring)
    for i in range(len(string) - n + 1):
        if string[i:i+n] == substring:
            count += 1
    return count

def how_many_times(string: str, substring: str) -> int:
    count = 0
    start = 0
    while True:
        start = string.find(substring, start)
        if start == -1:
            break
        count += 1
        start += 1
    return count

