def encode(message):
    vowels = "aeiouAEIOU"
    encoded_message = []

    for char in message:
        if char in vowels:
            # Replace vowel with the letter 2 places ahead
            if char.islower():
                new_char = chr(((ord(char) - ord('a') + 2) % 26) + ord('a'))
            else:
                new_char = chr(((ord(char) - ord('A') + 2) % 26) + ord('A'))
            encoded_message.append(new_char)
        else:
            # Swap case for non-vowel letters
            if char.islower():
                encoded_message.append(char.upper())
            else:
                encoded_message.append(char.lower())

    return ''.join(encoded_message)

