def closest_integer(value):
    num = float(value)
    floor = int(num)
    ceil = floor + 1 if num > 0 else floor - 1
    if abs(num - floor) < abs(num - ceil):
        return floor
    elif abs(num - floor) > abs(num - ceil):
        return ceil
    else:
        return ceil if num > 0 else floor

