def count_nums(arr):
    def sum_digits(num):
        if num < 0:
            digits = [int(d) for d in str(num)[1:]]
            digits[0] = -digits[0]
            return sum(digits)
        else:
            return sum(int(d) for d in str(num))

    return sum(1 for num in arr if sum_digits(num) > 0)

